import React,{useState, useEffect} from 'react';
import axios from 'axios';
import {FormControl, Modal} from 'react-bootstrap';

export default function PencarianBarang() {

	const [formCari, setFormCari] = useState(false);
	const [isi, setIsi] = useState('');

	return(

		<>
		<h1>Testing Pencarian</h1>
		<FormControl
          type="search"
          value="Cari"
          placeholder="Search"
          className="me-2"
          aria-label="Search"
          onClick={() => {setFormCari(true)}}
        />

        <Modal show={formCari} fullscreen={true} onHide={() => setFormCari(false)}>
        <Modal.Header closeButton>
          <Modal.Title>Modal</Modal.Title>
        </Modal.Header>
        <Modal.Body>
        <FormControl
          type="search"
          value={isi}
          placeholder="Search"
          className="me-2"
          aria-label="Search"
          onChange={(e) =>{setIsi(e.target.value)}}
        /></Modal.Body>
      </Modal>
		</>

		)
}
